using Microsoft.VisualStudio.TestTools.UnitTesting;
using System.IO;
using static PDFtoZPL.Conversion;

namespace Tests
{
    [TestClass]
    public class BitmapConversionTests
    {
        private const string expectedZpl = "^XA^GFA,102400,102400,160,,:::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::g0G1gHFgO0G7QFqV0:::mL0G7gW0G1GCgL0G7U0G1GCjP0mI0G1H0GFgU0G4G0G3GCgI0G1H0GFS0G4G0G3GCjP0mI0G1GFG7GEgU0G7GDGFG8gI0G1GFG7GES0G7GDGFG8jP0mI0G3HFGCgU0IFgJ0G3HFGCS0IFjQ0mJ0G7GEgV0G1GFG8gK0G7GET0G1GFG8jQ0,:::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::^FS^XZ";

        [TestMethod]
        public void ConvertFileNameInput()
        {
            var zplResult = ConvertBitmap(Path.Combine("Assets", "SocialPreview.png"));

            Assert.AreEqual(expectedZpl, zplResult);
        }

        [TestMethod]
        public void ConvertFileStreamInput()
        {
            using var fileStream = new FileStream(Path.Combine("Assets", "SocialPreview.png"), FileMode.Open, FileAccess.Read);
            var zplResult = ConvertBitmap(fileStream);

            Assert.AreEqual(expectedZpl, zplResult);
        }

        [TestMethod]
        public void ConvertByteArrayInput()
        {
            var zplResult = ConvertBitmap(File.ReadAllBytes(Path.Combine("Assets", "SocialPreview.png")));

            Assert.AreEqual(expectedZpl, zplResult);
        }
    }
}